import React from 'react';
import './css/HomePage.css';  // Since css is now inside src
import heroImage from './images/backGround.png';  // Use your correct image file

function HomePage() {
  return (
    <div className="home-page">
      {/* Hero Section */}
      <div className="hero-section" style={{ backgroundImage: `url(${heroImage})` }}>
        <div className="hero-overlay">
          <h1>Organic Ingredients</h1>
        </div>
      </div>

      {/* Navigation Section */}
      <nav className="nav-bar">
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/menu">Menu</a></li>
          <li><a href="/templates">Templates</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </nav>

      {/* Grid Section */}
      <div className="grid-section">
        <div className="grid-item">
          <img src="../images/menu-image.jpg" alt="Menu" />  {/* Replace with your actual image name */}
          <h2>Menu</h2>
        </div>
        <div className="grid-item">
          <img src="../images/happy-hour-image.jpg" alt="Happy Hour" />  {/* Replace with your actual image name */}
          <h2>Happy Hour</h2>
        </div>
        <div className="grid-item">
          <img src="../images/location-image.jpg" alt="Location" />  {/* Replace with your actual image name */}
          <h2>Location</h2>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
